    false,nt"url": null,nt"notes": "In 1961 an effort was launched to conduct
    a full scale operational aerial brood survey, previous experimental failures notwithstanding.
    The project was terminated as unsatisfactory when the production report came due
    in late July after only four days of actual transect flying. In lieu of aerial surveys,
    there is real hope for good production forecasts from ground studies if comparability
    can be developed through continuity of personnel and study areas. Logistics and
    mobility has been a major obstacle in the past, but this has been minimized to a
    large extent with the stowaway sectional skiff developed last year. This is an 11',
    1401 plastic boat with five nesting sections capable of fitting into a Cessna 180
    equipped with an auxiliary fuel tank.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
